import React from "react";

const ProductDetail = () => {
  return (
    <div>
      <div>Product name</div>
      <div>Price</div>
      <div>No Reviews</div>
      <div>Availability</div>
      <div>Hurry up! Only No products left in stock</div>
    </div>
  );
};

export default ProductDetail;
